const ButtonPopupBasketArray = [{
  className: 'popupBasketButton',
  text: 'Продолжить покупки',
  closePopup: true,
  addRemoveScroll: false,
  link: false,
},
{
  className: 'popupBasketButton',
  text: 'Перейти в корзину',
  closePopup: true,
  addRemoveScroll: true,
  link: true,
},
];

export default ButtonPopupBasketArray;
